import { Component } from '@angular/core';
import { IUser } from 'src/models';
import { ClasseroomService } from '../classeroom.service';
import { UserService } from '../user.service';

@Component({
  selector: 'app-classeroom',
  templateUrl: './classeroom.component.html',
  styleUrls: ['./classeroom.component.css']
})
export class ClasseroomComponent {
  receivedId=''
  Classes: any[] = [];
  Students:IUser [] = [];
  constructor(private student:UserService,private Cla:ClasseroomService){}
  ngOnInit(): void {
    this.student.getAll()
    .subscribe((data: IUser[]) => {
      // Filter users by role 'student'
      this.Students = data.filter(user => user.role === 'Student');
      console.log(this.Students);

    });
    this.Cla.classes$.subscribe((classes) => {
      this.Classes = classes;
    });
    console.log(this.Classes);

    this.fetchClasses();
  }

  fetchClasses() {
    this.Cla.getClasse().subscribe(
      (classes) => {
        // This will update the Classes array when classes are fetched
        this.Classes = classes;
        console.log(this.Classes);
      },
      (error) => {
        // Handle errors here
        console.error('Error fetching classes:', error);
      }
    );
  }

  onItemClick(itemId: string) {
    this.receivedId = itemId;
  }

  deleteClasse(userId: string){
    this.Cla.deleteClasse(userId).subscribe(
      () => {
        // Handle the success of the deletion here
        console.log(`Class with ID ${userId} deleted successfully.`);
        this.fetchClasses();
      },
      (error) => {
        // Handle any errors that may occur during deletion
        console.error(`Error deleting class with ID ${userId}:`, error);
      }
    );
  }
}

<div class="d-flex justify-content-between">
    <select class="form-select" aria-label="Default select example">
        <option selected>Open this select menu</option>
        <option value="1">One</option>
        <option value="2">Two</option>
        <option value="3">Three</option>
      </select>
    <button class="btn btn-primary">
        <span class="btn-label">
            <i class="fa fa-archive"></i>
        </span>
        Ajouter Classe
    </button>
</div>
<div class="row row-cols-1 row-cols-lg-4 gap-4 mb-4">
    <div *ngFor="let item of Classes" class="col flex flex-column h-40 rounded-xl cursor-pointer bg-primary text-white">
        <p class="text-xl p-4 pt-6">
            {{item.name}}
        </p>
        <div class="d-flex justify-content-between text-white p-4">
            <i class="fas fa-box text-xl"></i>
            <div class="d-flex gap-1">
                <a [routerLink]="['/dashboard/ajcla']" class="btn btn-white btn-sm font-weight-medium text-center text-primary bg-white rounded-circle hover-bg-slate cursor-pointer">
                    <i class="fas fa-pen"></i>
                </a>
                <a (click)="onItemClick(item._id)" data-toggle="modal" data-target="#deleteClasse" class="btn btn-white btn-sm font-weight-medium text-center text-primary bg-white rounded-circle hover-bg-slate cursor-pointer">
                    <i class="fas fa-trash"></i>
                </a>
            </div>
        </div>
        <div class="d-flex justify-content-between p-4">
            <p class="text-white text-md">Student</p>
            <p class="text-md text-white">{{item.students.length}}</p>
        </div>
    </div>
    <div data-toggle="modal" data-target="#exampleModalCenter" class="col flex flex-column justify-content-center items-center h-40 rounded-xl cursor-pointer bg-pink text-white">
        <p class="text-3xl">
            <i class="fas fa-plus text-3xl"></i>
        </p>
        <p class="text-white text-xl">Ajouter Classe</p>
    </div>
</div>
